/**
 * This is the entrypoint for the dashboard. It returns the details of the dashboard configuration as an object with the following shape:
 * {
 *   serverUrls: [string], // The list of server URLs that have been used to launch the dashboard, which can be used to populate a dropdown in the UI
 *   lastServerUrl: string, // The server URL that was used to launch the most recent dashboard, which can be used as the default selection in the UI
 *   context: object // Details about the page from which the dashboard was launched, which can be used to provide context to the AI Assistant LLM when processing prompts
 * }
 */
function dashboardGetConfig(callback) {
    chrome.storage.local.get("dashboardConfig", config => callback(config.dashboardConfig));
}

/**
 * Provides operations for interacting with the AI Assistant LLM from the dashboard:
 * - `dashboardSendPrompt` executes a prompt and returns an object containing the response and the state of the response (success, error, confirmation).
 * - `dashboardApprovePrompt` approves a pending confirmation and returns an object containing the updated response and its state.
 * In both cases, the `serverUrl` is used to obtain an access token for the API call and to route the request to the correct dashboard instance.
 */

const [dashboardSendPrompt, dashboardApprovePrompt] = function () {

    function getAccessToken(serverUrl) {
        return _dashboardGetOctopusCsrfTokenFromCookie(new URL(serverUrl).hostname)
            .then(csrfToken => {
                if (!csrfToken) {
                    throw new Error("No Octopus-Csrf-Token cookie found for server URL: " + serverUrl);
                }
                return csrfToken;
            })
            .then(csrfToken => fetch(new URL('/api/users/access-token', serverUrl), {
                headers: {
                    'Content-Type': 'application/json',
                    'X-Octopus-Csrf-Token': csrfToken
                },
                method: 'POST',
                credentials: 'include'
            }))
            .then(response => {
                if (!response.ok) {
                    throw new Error(`API call failed: ${response.status} ${response.statusText}`);
                }
                return response;
            })
            .then(response => response.json())
            .then(json => json.AccessToken);
    }

    function dashboardApprovePrompt(id, serverUrl) {
        if (!_isValidUrl(serverUrl)) {
            return Promise.resolve({
                response: "The server URL is not valid. Please check the URL and try again.",
                state: "Error"
            })
        }

        return getAccessToken(serverUrl)
            .then(token =>
                chrome.runtime.sendMessage({
                    action: "confirmation",
                    id: id,
                    accessToken: token,
                    serverUrl: serverUrl
                })
            )
            .then(result => _dashboardConvertFromSseResponse(result))
            .catch(error => {
                console.log("Error approving confirmation in dashboard: ", error);
                return {
                    response: "An error occurred while processing your request. Please sign in to Octopus and try again.",
                    state: "Error"
                }
            });
    }

    function dashboardSendPrompt(prompt, serverUrl) {
        if (!_isValidUrl(serverUrl)) {
            return Promise.resolve({
                response: "The server URL is not valid. Please check the URL and try again.",
                state: "Error"
            })
        }

        return getAccessToken(serverUrl)
            .then(accessToken => chrome.runtime.sendMessage({
                action: "prompt",
                prompt: prompt,
                accessToken: accessToken,
                serverUrl: serverUrl
            }))
            .then(result => _dashboardConvertFromSseResponse(result))
            .catch(error => {
                console.log("Error sending prompt to dashboard: ", error);
                return {
                    response: "An error occurred while processing your request. Please sign in to Octopus and try again.",
                    state: "Error"
                }
            });
    }

    function _isValidUrl(url) {
        try {
            new URL(url);
            return true;
        } catch (e) {
            return false;
        }
    }

    /**
     * Gets the Octopus CSRF token from the browser cookies for the given server URL.
     */
    function _dashboardGetOctopusCsrfTokenFromCookie(domain) {
        return chrome.cookies.getAll({domain: domain})
            .then(cookies => cookies
                .filter(cookie => cookie.name.startsWith('Octopus-Csrf-Token'))
                .map(cookie => cookie.value)
                .pop())
            .then(token => {
                if (!token) {
                    return Promise.reject(new Error("No Octopus CSRF token cookie found. Please sign in to Octopus and try again."));
                }
                return token;
            })
    }

    /**
     * Convert the SSE response from the dashboard into a format that can be displayed in the UI.
     */
    function _dashboardConvertFromSseResponse(sseResponse) {
        if (sseResponse.error) {
            return {
                response: sseResponse.error,
                state: "Error"
            };
        }

        if (_dashboardIsActionSseResponse(sseResponse.response)) {
            return _dashboardConfirmationResponse(sseResponse.response)
        }

        return {
            response: _dashboardConvertFromSuccessSseResponse(sseResponse.response),
            state: "Success"
        };
    }

    /**
     * Check if the SSE response is an action response that requires confirmation.
     */
    function _dashboardIsActionSseResponse(sseResponse) {
        return !!sseResponse
            .split('\n')
            .filter(line => line.trim())
            .filter(line => line.startsWith('data: '))
            .map(line => JSON.parse(line.replace('data: ', '')))
            .filter(response => 'type' in response && response.type === 'action')
            .pop()
    }

    /**
     * Extract the confirmation message and id from the SSE response.
     */
    function _dashboardConfirmationResponse(sseResponse) {
        return sseResponse
            .split('\n')
            .filter(line => line.trim())
            .filter(line => line.startsWith('data: '))
            .map(line => JSON.parse(line.replace('data: ', '')))
            .filter(response => 'type' in response && response.type === 'action')
            .map(response => {
                return {
                    response: response.title + "\n\n" + response.message,
                    state: "Confirmation",
                    id: response.confirmation.id
                }
            })
            .pop()
    }

    /**
     * Convert a successful SSE response from the dashboard into a format that can be displayed in the UI.
     */
    function _dashboardConvertFromSuccessSseResponse(sseResponse) {
        const responses = sseResponse
            .split('\n')
            .filter(line => line.trim())
            .map(line => JSON.parse(line.replace('data: ', '')));

        const contentResponses = responses
            .filter(response => 'content' in response.choices[0].delta);

        return contentResponses
            .map(line => line.choices[0].delta.content.trim())
            .join('\n');
    }

    return [
        dashboardSendPrompt,
        dashboardApprovePrompt
    ]
}()



